        \addplot[only marks, mark=*, black] coordinates {(0.63,-0.18)};

        % Labels
        \node[blue, right] at (axis cs:0,-4) {Runner A};
        \node[red, right] at (axis cs:0,3) {Runner B};
        \node[above] at (axis cs:0.63,-0.18) {Meeting point};
    \end{axis}
\end{tikzpicture}

\end{document}

```

