    % Triangle with colored components
    \draw[thick,red] (0,0) -- (4,0) node[below] {$a$};
    \draw[thick,blue] (4,0) -- (4,3) node[right] {$b$};
    \draw[thick,yellow] (0,0) -- (4,3) node[left] {$r$};

    % Right angle marker
    \draw (3.8,0) -- (3.8,0.2) -- (4,0.2);

